  \"2016-07-04T21:17:23.822434\",\n\t\"name\": \"astoria-oregon-1-3-arc-second-mhw-coastal-digital-elevation-model-vers-3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's National Centers for Environmental
  Information (NCEI) is building high-resolution digital elevation models (DEMs) for
  select U.S. coastal regions. These integrated bathymetric-topographic DEMs are used
  to support individual coastal States as part of the Pacific Marine Environmental
  Laboratory's (PMEL) efforts to support NOAA's tsunami forecast system and for tsunami
  inundation modeling, improve community preparedness and hazard mitigation. Bathymetric,
  topographic, and shoreline data used in DEM compilation are obtained from various
  sources including: NOAA; the U.S. Geological Survey (USGS); and other federal, state,
  and local government agencies, academic institutions, and private companies. DEMs
  are referenced to the vertical datum of MHW and horizontal datum of World Geodetic
  System 1984 geographic (WGS 84). Grid spacing for the DEM is 1/3 arc-second (~10
  meters).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
